contracts/AfterRead.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.23;

/*
1) Send ethereum
2) Get balance
3) Deposit
4) Withdraw
*/

library Details {

    struct Transaction {
        string transactionType;
        string sender;
        string receiver;
        uint transferedAmount;
    }


    struct Account {
        string username;
        address accountAddress;
        uint balance;
        uint numberOfTransaction;
        mapping (uint number => Transaction transaction) transactionHistory;

    }

}
error SelfSending(address sender1, address receiver);


contract Start {
    address payable owner = payable(msg.sender);
    uint public number;

    mapping (uint ID => Details.Account account) accounts;
    mapping (uint ID => address payable addr) addresses;

    function createAccount(string calldata name) public {
        accounts[++number].username = name;
        addresses[number] = payable(msg.sender);
        accounts[number].accountAddress = payable(msg.sender);
    }

    function deposit(address payable to) public payable  {
        require(owner == msg.sender, "You should be the owner. Aborting!");
        if (msg.sender == to)
        revert SelfSending(msg.sender, to);
        else {
            require(accounts[number].balance >= msg.value);
            to.transfer(msg.value);
            accounts[number].balance -= msg.value;
        }
    }
}

